import React from "react";

const Cards = ({ movie }) => {
  console.log(movie);

  return (
    <div className="card-container">
      <img
        src={"https://image.tmdb.org/t/p/original" + movie.poster_path}
        alt=""
      />
      {movie.title}
    </div>
  );
};

export default Cards;
